import React,{useEffect,useState} from "react";
import axios from "./Request/axios";

function Row(props){

    const[movies,setMovies] = useState([]);

    useEffect(()=>{
       async function fetchData(){
           const request = axios.get(props.request)
           console.log(request);
       }
       fetchData();
        },[props.request]);
    return(
    <div>
        <h2>{props.title}</h2>
    </div>
    );
}

export default Row;
